import React from "react";
import ReactDOM from "react-dom";

ReactDOM.render(
  <div>
    <h1>My Favorite Foods</h1>
    <ul>
      <li>Sushi</li>
      <li>Pizza</li>
      <li>Fit Food</li>
    </ul>
  </div>,
  document.getElementById("root")
);
